#include <Windows.h>\n\nint main() {\n    HKEY hKey;\n    RegOpenKeyEx(HKEY_CLASSES_ROOT, L"TypeLib", 0, KEY_READ, &hKey);\n\n    // Enumerate the subkeys\n    DWORD cSubKeys;\n    RegQueryInfoKey(hKey, NULL, NULL, NULL, &cSubKeys, NULL, NULL, NULL, NULL, NULL, NULL, NULL);\n    for (DWORD i = 0; i < cSubKeys; i++) {\n        WCHAR subKeyName[MAX_PATH];\n        RegEnumKeyEx(hKey, i, subKeyName, MAX_PATH, NULL, NULL, NULL, NULL);\n\n        // Open the subkey\n        HKEY hSubKey;\n        RegOpenKeyEx(hKey, subKeyName, 0, KEY_READ, &hSubKey);\n\n        // Get the DLL name\n        WCHAR dllName[MAX_PATH];\n        RegQueryValueEx(hSubKey, L"1.0\0\win32", NULL, NULL, (LPBYTE)dllName, MAX_PATH);\n\n        // Print the DLL name\n        wprintf(L"%s\n", dllName);\n\n        // Clean up\n        RegCloseKey(hSubKey);\n    }\n\n    // Clean up\n    RegCloseKey(hKey);\n    return 0;\n}